import '../styles/Header.css';

const Header = (props) => {
    return (
        <header>
        <div className="holder">
          <img src="img/Logo Adketing_2.png" width="100" alt="ADKETING" />
          <h1>Advertising & Marketing</h1>
        </div>
      </header>
    )
}

export default Header;
